import { createApi, fetchBaseQuery } from '@reduxjs/toolkit/query/react';

// Note: Change v1 to v2 on rapid api

const youtubeapiheaders = {
    'X-RapidAPI-Host': 'youtube-search-and-download.p.rapidapi.com',
    'X-RapidAPI-Key': '25e1590e68mshea028178cfe7dc5p1c6cd4jsn264b5bf7bb53'
};
const createRequest = (url) => ({ url, headers: youtubeapiheaders });

baseUrl = 'https://youtube-search-and-download.p.rapidapi.com'

export const youtubeApi = createApi({
    reducerPath: 'youtubeApi',
    baseQuery: fetchBaseQuery(baseUrl),
    endpoints: (builder) => ({
        getVideoinfo: builder.query({
            query: () => createRequest('/video'),
        }),

        // getCryptoHistory: builder.query({
        //     query: ({ coinId, timeperiod }) => createRequest(`coin/${coinId}/history?timeperiod=${timeperiod}`),
        // }),

        // getExchanges: builder.query({
        //     query: () => createRequest('/exchanges'),
        // }),
    }),
});

export const {
    useGetVideoinfoQuery,
} = youtubeApi;
